INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('ab5e6b15-3ac3-46e3-bf9f-0f6bdd86df58', null, 'Students are required to prepare papers based upon current scientific publications relating to animal science, or upon their research work, for presentation before and discussion by the class; (1) recent advances; (2) nutrition; (3) physiology; (4) biochemistry.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('2573199d-4f3e-4a32-88d5-458463711774', null, 'Human biological evolution, including the biology of contemporary human groups, non-human primate social behavior, and the fossil, biochemical, and molecular evidence for human evolution. Includes a laboratory study of human population genetics, biochemical variation, and anatomical diversity in modern and fossil human and non-human primate groups.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('ba6da522-8aa0-467e-97d9-2daecdc4b9cc', null, 'Exploration of the variety of past human societies and cultures through archaeology, from the emergence of anatomically modern humans to the more recent historical past.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('63e3270d-4bb8-4e97-9fa8-2f8be03cf053', null, 'Culture and social relationships in a wide variety of settings from small-scale to complex societies. An overview of how anthropology analyzes human behavior. Particular attention to the relationship between language and culture.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('d7dad0db-b6e3-4c28-a779-c457d0e0936c', null, 'Culture and social relationships in a wide variety of settings from small-scale to complex societies. An overview of how anthropology analyzes human behavior. Particular attention to the relationship between language and culture.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('2dbe8dd0-321b-4ff2-aea4-792183901888', null, 'Theoretical and methodological overview of biological anthropology, including evolutionary anthropology, anthropological genetics, physiological anthropology, human biology, primatology, paleoanthropology, human biodiversity, and comtemporary selective challenges to modern humanity. Emphasis on core concepts and their research applications.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('c7389c9f-4f0a-45ca-a1d6-e92da27d823b', null, 'Theory, method, and practice which guides modern anthropological archaeology. Includes research design and execution (from survey through excavation and interpretation), the reconstruction of aspects of past cultures, and the understanding of cultural change and meaning.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('b0a86a82-287e-4fe4-a8cf-e6de2218aa65', null, 'Theoretical approaches and research methods in sociocultural anthropology. Emphasis on current debates, new directions, and their historical antecedents.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('c70cf13a-f01c-4498-a96a-e813fb422c9b', null, 'Examination of the cultures native to North America, including the land areas of Canada, the United States of America, and the major portion of the Republic of Mexico.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('6cf35c8b-b39d-4476-bf98-864506e461f5', null, 'Examination of the cultures native to North America, including the land areas of Canada, the United States of America, and the major portion of the Republic of Mexico.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('dc07c541-b9e4-4508-bee2-a99f4c7b5540', null, 'American humor from the Colonial era through the present in genres including literature, journalism, graphic arts, performance, and modern media. How humor expresses and mediates important social and cultural concerns including politics, religion, race and ethnicity, gender and topical issues.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('ba41a0d1-da7c-47f4-a7df-3ed91749e60d', null, 'Developments in theories and methods of American Studies scholarship, with emphasis upon interaction between the humanities and the social sciences in the process of cultural analysis and evaluation.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('772aef36-652e-432b-bfe3-c8c73dcdd9bc', null, 'Topics of special interest.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('408d6490-5868-460f-96c2-29cbdf6c436f', null, 'Explores the formative literature, theories, research approaches, and history of American Studies.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('f3266b66-6020-4ffc-bc23-31d01d40ce08', null, 'Advanced instruction interdisciplinary research strategies, bibliography, and the structure of systems of scholarly communication in the fields and subfields of American Studies.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('95679153-55aa-4979-8161-292e8f8c1019', null, 'Builds on AMST601 and explores contemporary literature, theory, and intellectual issues in American Studies.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('a588b92c-4b95-4c05-8a29-a438e2f87b5a', null, 'Provides students a basic understanding of museums as culturarl and intellectual institutions. Topics include the historical development of museums, museums as resources for scholarly study, and the museum exhibition as medium for presentation of scholarship.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('bf1032e9-360d-4080-8b93-e2e46dec7c96', null, 'This course is designed to provide students with the opportunity to pursue independent, interdisciplinary research and reading in specific aspects of American culture under the supervision of a faculty member.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('f59edf29-51b5-4dfe-a757-79cc75ab60e3', null, 'A research writing seminar that provides students with an opportunity to complete an original research project to gain experience in related scholarly activities (proposing and configuring research and making conference-style presentation).',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('3070ff0f-6974-4d1d-a339-d5abb3e27fa5', null, 'A research seminar that provides students an opportunity to survey the principal approaches to studying a cultural landscape, learn how to apply and adapt a field research method, and produce a primary research report on a cultural landscape of their choice.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('140ca2e5-499a-45e5-a957-ee03603621b3', null, 'A research seminar focusing on the practice and presentation of cultura  and historical scholarship in museums and historical sites. Students will complete an original research project on the challenges and opportunities of public exhibition and interpretation of cultural and historical research.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('af23c2c0-4018-4313-bdfb-7776a5c5a1c7', null, 'Students devise and carry out a research program using the collections at the Smithsonian Institution or some other cooperating museum, working under joint supervision of a museum professional and a university faculty member.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('dc137f92-5340-43bf-9009-4a951e7d315c', null, 'A survey of Asian American literature with an emphasis on recurrent themes and historical context.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('bb10e06c-985c-4578-959a-014925adedb5', null, 'An introductory multidisciplinary and interdisciplinary educational experience to explore issues relevant to Asian American life, cultural experiences, and political, economic, and artistic development.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('ad21e6fc-a57d-457c-81a4-1858c361889d', null, 'Field experience in professional organizations and appropriate private and governmental agencies serving the Asian American community.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('276dd520-a3cf-430b-9122-90595ab38f43', null, 'Directed research in Asian American Studies resulting in the completion of a thesis.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('95626421-5208-4607-bd14-3bd5eac1732d', null, 'Study of a specific theme or issue involving the Asian America experience.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('2784f0ba-6240-4dea-bc06-1946248a8de0', null, 'Analysis of race-related issues, with a primary focus on American society. The historical emergence, development, and institutionalization of racism; the impact of racism on its victims; and racially based conflict.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('d4b8f13a-0132-4143-bca6-5e6218f2d701', null, 'Advanced study of the cultural and historical antecedents of contemporary Asian American society. Emphasis on the social, political, economic, and behavioral factors affecting Asian Americans and their communities.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('110e43c9-e51f-464f-893c-d21d5153b81b', null, 'Significant aspects of the history of African Americans with particular emphasis on the evolution and development of black communities from slavery to the present. Interdisciplinary introduction to social, political, legal and economic roots of contemporary problems faced by blacks in the United States with applications to the lives of other racial and ethnic minorities in the Americas and in other societies.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('94c048e6-3208-401c-bd2d-b0bb8127b10e', null, 'The impact of public policies on the black community and the role of the policy process in affecting the social, economic and political well-being of minorities. Particular attention given to the post-1960 to present era.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('4a7721fc-b10d-497a-b713-e6d1b8bcdd24', null, 'A survey of African civilizations from 4500 B.C. to present. Analysis of traditional social systems. Discussion of the impact of European colonization on these civilizations. Analysis of the influence of traditional African social systems on modern African institutions as well as discussion of contemporary processes of Africanization.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('1ccd09dd-8a12-4561-9567-6aafe94f342e', null, 'The course examines important aspects of African American life and thought which are reflected in African American literature, drama, music and art. Beginning with the cultural heritage of slavery, the course surveys the changing modes of black creative expression from the 19th-century to the present.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('3e5c8adc-ce48-4bbf-ab89-8c6bab8f3dc2', null, 'Introduces African American Studies majors to the basic research skills methodologies, sources, and repositories for studying African Diaspora. Students will be required to select a research topic, write a research proposal, develop an annotated bibliography, and in the process will be prepared for completing their senior thesis or other significant writing projects necessary to fulfill the requirements of the major.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('58171da1-d680-455c-87be-0eeab2db5a59', null, 'An introductory multi-disciplinary and inter-disciplinary educational experience to explore issues relevant to black life, cultural experiences, and political, economic, and artistic development.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('9ef9b696-88dd-46d6-b5d2-3580510427bc', null, 'Development and application of the tools needed for examining the effectiveness of alternative policy options confronting minority communities. Review policy research methods used in forming and evaluating policies. Examination of the policy process.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('48b56c12-dfba-404a-956d-34e848cc26b9', null, 'Introduction to statistics and database processing software used in model estimation and simulation in policy analysis. Special emphasis on applications for applied research on policy problems confronting minority communities.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('dff540a4-bac1-4712-9776-7040ae923588', null, 'Theories and concepts in the social and behavioral sciences relating to problems in minority communities. Issues include validity and soundness of theoretical arguments, epistemological questions of various methodologies and the relationship between policy making and policy research.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('093eaffb-0f61-4bfe-8a68-f0d4f69bf711', null, 'The relationship of the slave trade of Africans to the development of British capitalism and its industrial revolution; and to the economic and social development of the Americas.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('3248e505-410d-49c1-bd49-0d216c9acb2c', null, 'Black American women''s history is examined from slavery to the present. The principal focus of the readings discussions and student assignments will be based upon gaining a fuller understanding of the effect of race, class and gender on the life cycles and multiple roles of Black women as mothers, daughters, wives, workers and social change agents. A variety of primary source materials on black women''s experiences will be utilized.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('45ffc1f6-324f-4fc8-a403-8343f50e8686', null, 'Survey of the twentieth century civil rights movement from the desegregation of UM Law School through the National Black Political Congress in Gary in 1972. Major themes include leadership, legal and constitutional challenges, non-violence, Black Power, Pan-Africanism.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('0d015871-2a71-4471-a695-09de5cb32713', null, 'A research seminar that allows African American Studies majors to complete an independent study research project in lieu of completing the AASP397: Senior Thesis. Students will examine various concepts of race, gender, labor and ethnicity in the seminar lecture component to be applied toward their specific research projects.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('22d1eac6-c431-4816-b3e4-2c81fa1581ce', null, 'Directed research in African American Studies resulting in the completion and defense of a senior thesis.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('7bc2b809-3701-402c-b292-f90f09c492b2', null, 'Analysis of the historical experiences and cultures of Africans in the diaspora.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('a4e52312-e762-423c-901b-af200e907088', null, 'The readings will be directed by the faculty of African American Studies. Topics to be covered will be chosen to meet the needs and interests of individual students.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('55effe34-4478-4006-965e-0f0fba601c50', null, 'Classic readings of the social, economic and political status of blacks and other minorities in the United States and the Americas.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('472da2bc-c593-425c-b95e-ddad27d5c8ae', null, 'Scientific knowledge and skills in solving technological and social problems, particularly those faced by the black community. Examines the evolution and development of African and African American contributions to science. Surveys the impact of technological changes on minority communities.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('56863ff2-7b31-47eb-8d5d-6d9f04177e30', null, 'The relationship between black Americans and the law, particularly criminal law, criminal institutions and the criminal justice system. Examines historical changes in the legal status of blacks and changes in the causes of racial disparities in criminal involvement and punishments.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('dd0a09cf-d0f8-453c-9605-72661f1cb15f', null, 'Cultural, historical and artistic dimensions of the African experience in Africa and the Americas.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('a674dd70-6036-4637-92a8-021c7d2dea51', null, 'Examining the historical, economic, social, and scholarly construction of African American family structures. The problematization of "Black matriarchy," hetero- and homosexuality, bi-racialism, and other efforts to "normalize" African Americans to conform to Eurocentric and religious concepts of family will be critically analyzed.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('272b6264-86b2-4455-848b-987ac4e0e173', null, 'Advanced study of the cultural and historical antecedents of contemporary African and African American society. Emphasis on the social, political, economic and behavioral factors affecting blacks and their communities. Topics vary.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('8681e7fb-9fd1-4901-9a6f-2854b1de0ae5', null, 'Examination of specific areas of policy development and evaluation in black and other communities. Application of advanced tools of policy analysis, especially quantitative, statistical and micro-economic analysis.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('094e8490-197e-4d81-8e9b-6bcbff542758', null, 'This course explores the role of race in social policy formation and emphasizes the importance of both political institutions and economic relations as determinants of the policy making process and context.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('1b2eb5ff-333a-44a3-9864-299230e550b7', null, 'The aggregate experience of Asian Pacific Americans, from developments in the countries of origin to their contemporary issues. The histories of Asian Pacific American groups as well as culture, politics, the media, and stereotypes, viewed from an interdisciplinary perspective.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('3bd70ed8-d64e-47e3-8264-6addd266c54d', null, 'Introduction to the history of Asian Americans in the United States and the Americas and to the field of Asian American Studies, from an interdisciplinary perspective. Topics include theories of race and ethnicity; Asian migration and diaspora to the Americas; Asian American work and labor issues; gender, family, and communities; nationalism and nativism, and anti-Asian movements; Asian Americans, World War II, the Cold War, and the issues in the civil rights & post-civil rights era.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('bc000951-3e49-4f85-a864-f7688b201e5e', null, 'Introduction to the history of Asian Americans in the United States and the Americas and to the field of Asian American Studies, from an interdisciplinary perspective. Topics include theories of race and ethnicity; Asian migration and diaspora to the Americas; Asian American work and labor issues; gender, family, and communities; nationalism and nativism, and anti-Asian movements; Asian Americans, World War II, the Cold War, and the issues in the civil rights & post-civil rights era.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('edd11737-aa46-43fe-b4b2-5a429649efd8', null, 'Concepts involved in planning and executing nonformal educational programs developed to meet the needs of youth. Emphasize the identification of opportunities; needs, and problems of youth in all socioeconomic levels; analysis of methods of working with youth groups and developing volunteer staff.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('601002d1-2cab-424b-a551-ab9025eccb5e', null, 'A survey reading course. Plots the global progression of agriculture toward industrialization and conflicts along the way. Reviews major trends, highlights contrasting perspectives, and reviews contemporary issues in agriculture and agricultural development.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('adc153f9-b9a9-421d-87a9-b725c52c5b53', null, 'Undergraduate honors thesis research conducted under the direction of an AGNR faculty member in partial fulfillment of the requirements of the College of AGNR Honors Program. The thesis will be defended to a faculty committee.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('f412c3e0-d601-4db6-bf55-bb2172c6f0a5', null, 'Examination of the social and ethical issues that shape extension''s rol in the agriculture sector of countries worldwide and that determine its contribution to international development. Review of a wide range of literature from scholars, governments, and international organizations.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('792616b6-6ce3-4cb1-92bf-6002996ca4c9', null, 'Immersion-based, intensive course of study in a foreign agricultural education setting. UM Students will study with local students in a variety of University classes and field experiences in agriculture, natural resources and environmental sciences, laboratory science, economics, education technology, etc. Students will learn customs, culture and language of the host country.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('21d6e3c3-cde3-41fc-9b83-6ebbad3557ed', null, 'Immersion-based, intensive course of study in a foreign agricultural setting. Students may expect to have university classes and field experiences in one or more agriculture and natural resource disciplines. Students will learn about the culture and customs of the host country as well as undertake at least an introductory language course.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('9f47a080-d111-4096-84a8-c390e851163e', null, 'Credit according to time scheduled and organization of the course. A lecture series organized to study in depth a selected phase of agriculture not normally associated with one of the existing programs.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('5261cea7-c3f1-4413-a219-d8ba6b7a3a0e', null, 'An introduction to American popular culture, its historical development, and its role as a reflection of and influence on our culture and society.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('b0766694-5d6c-42db-9b20-3473fe182c1d', null, 'Exploration of the American film from a historical perspective, illustrating the motion picture''s role as an institutional phenomenon, as a form of communication, and as a source of cross-cultural study.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('c6743655-7369-4480-bd77-9030fca49c92', null, 'Historical survey of American material culture. Ways of describing and interpreting accumulated material evidence (e.g., buildings, town plans) introduced by stressing relationship between artifact and culture.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('3986fe0a-f2ab-4443-be4e-3cffc70534f3', null, 'World views, values, and social systems of contemporary American cultures explored through readings on selected groups such as middle-class suburbanites, old order Amish, and urban tramps.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('fa4c2fe9-5960-4f36-98d5-710f9fa03fce', null, 'Exploration of the role of diversity in the shaping of American culture. Special emphasis will be placed on the multicultural origins of American popular and material culture, such as foodways and entertainment, and on the experience of "Americanization."',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('823d8a67-415a-477e-af6b-1d5950b08603', null, 'Examines the ways in which content and form of public information interact with the culture, families & individuals.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('0adbc3d5-1b91-43c1-aa9f-237d374daf86', null, 'Cultural study of a specific theme or issue involving artifacts and documents from both past and contemporary American experience.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('c4cb56e4-512e-43a0-b7ad-fe73557fe10e', null, 'Philosophies of American social purpose and promise. Readings from "classical" American thinkers, contemporary social commentators, and American studies scholars.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('2a6e92cb-e793-4789-bb37-bbfbf92db867', null, 'Introduction to the process of interdisciplinary research, including research literatures, questions, first-hand sources and library and analytic methods in American Studies. Each student will craft a prospectus for original research.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('a28be30b-1286-4c40-a4b0-0e6dcf1486a4', null, 'Individual research, thesis and oral defense. The research project will be conducted under the supervision of a faculty member.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('8a6edbe9-de60-452a-877e-d513ba3581d1', null, 'Provides the student with the opportunity to pursue independent, interdisciplinary research and reading in specific areas of American culture studies.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('d5e59d71-fac4-4695-910c-5937f819dec7', null, 'Examination of structure and development of American culture through themes such as "growing up American," "culture and mental disorders," "race," "ethnicity," "regionalism," "landscape," and "humor."',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('1ad02a8a-621b-4eb1-840d-93a393846653', null, 'Topics in popular culture studies, including the examination of particular genres, themes, and issues.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('e513ae6e-bd86-43e0-9629-b56e14596223', null, 'An introduction to mathematical dynamics and chaos. Orbits, bifurcations, Cantor sets and horseshoes, symbolic dynamics, fractal dimension, notions of stability, flows and chaos. Includes motivation and historical perspectives, as well as examples of fundamental maps studied in dynamics and applications of dynamics.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('e1e24570-ebb8-4eca-aa18-a1ec61636928', null, 'Basic computational methods for interpolation, least squares, approximation, numerical quadrature, numerical solution of polynomial and transcendental equations, systems of linear equations and initial value problems for ordinary differential equations. Emphasis on methods and their computational properties rather than their analytic aspects. Intended primarily for students in the physical and engineering sciences.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('d5b428f6-8e91-47ad-acfb-4d91677797e4', null, 'Floating point computations, direct methods for linear systems, interpolation, solution of nonlinear equations.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('60608680-942c-4ff9-aa14-4b0163a588d4', null, 'Advanced topics in numerical linear algebra, such as dense eigenvalue problems, sparse elimination, iterative methods, and other topics.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('5bca8955-b0a8-42cf-aac0-e6e39e2faca2', null, 'Modern numerical methods for solving unconstrained and constrained nonlinear optimization problems in finite dimensions. Design of computational algorithms and the analysis of their properties.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('47bfd8c8-b624-4e7a-9bfc-55ba1b62df21', null, 'Finite difference methods for elliptic, parabolic, and hyperbolic partial differential equations. Additional topics such as spectral methods, variational methods for elliptic problems, stability theory for hyperbolic initial-boundary value problems, and solution methods for conservation laws.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('9ff34f6e-994a-484a-9284-bca710c3a97e', null, 'Tools and techniques of computational linear algebra for applications. Topics include: linear systems and least squares problems, error analysis, accuracy and stability, matrix decompositions, iterative solvers, Krylov subspace methods, symmetric and non-symmetric eigenvalue problems, singular value decomposition.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('a05fbec9-c1ba-42b6-8aff-b8fe7ba23084', null, 'Variational formulations of linear and nonlinear elliptic boundary value problems; formulation of the finite element method; construction of finite element subspaces; error estimates; eigenvalue problems; time dependent problems.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('32ad88ad-a819-43ff-8b65-c4e03ae6ce14', null, 'Introduction to current signal/image processing techniques, including wavelets and frames, in the context of applied and numerical harmonic analysis. Topics include time-frequency and time-scale representations, sub-band filterbanks, and applications to compression and denoising.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('632ba631-ba27-469e-ab43-7f17fb5e6609', null, 'Monte Carlo simulation, numerical linear algebra, nonlinear systems and continuation method, optimization, ordinary differential equations. Fundamental techniques in scientific computation with an introduction to the theory and software of each topic.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('7f9c7a84-1e25-43ca-925f-200ce1ca0892', null, 'Fourier and wavelet transform methods, numerical methods for elliptic partial differential equations, numerical linear algebra for sparse matrices. Finite element methods, numerical methods for tiem dependent partia l differential equations. Techniques for scientific computation with an introduction to the theory and software for each topic. Course is part of a two course sequence (660 and 661), but can be taken independently.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('59628c72-f3f3-4e3e-b3d2-c9531cd1b2c1', null, 'This course presents fundamental issues of computer hardware, software, parallel computing, and scientific data management for programming for scientific computation.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('7d7b8605-3f67-4429-be93-5021d753a322', null, 'In the sequence MAPL 663, MAPL 664 students work on a year-long individual project to develop software for a scientific task in a high perfomance computing environment. Lectures will be given on available computational environments, code development, implementation of parallel algorithms.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('903a9bb2-c3cd-4660-b84a-b05ae6bd8992', null, 'In the sequence MAPL 663, MAPL 664 students work on a year-long individual project to develop software for a scientific task in a high perfomance computing environment. Lectures will be given on available computational environments, code development, implementation of parallel algorithms.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('60047f4d-b18c-4e0b-96a7-60c242c8e1a0', null, 'In the sequence MAPL 663, MAPL 664 students work on a year-long individual project to develop software for a scientific task in a high performance computing environment. Lectures will be given on code development and validation, parallel algorithms for partial differential equations, nonlinear systems, optimization.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('53980ee9-6063-46f7-a43d-5c259b9ff952', null, 'Iterative methods for linear systems, piecewise interpolation, eigenvalue problems, numerical integration.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('abd7318c-fd3d-4aa9-ac30-332554b6aeb2', null, 'Nonlinear systems of equations, ordinary differential equations, boundary value problems.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('993715a1-0d43-4688-b174-63f94c397c97', null, 'Existence and uniqueness, linear systems usually with Floquet theory for periodic systems, linearization and stability, planar systems usually with Poincare-Bendixson theorem.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('c2586334-2f80-4891-aeb4-3ac617ce871b', null, 'The content of this course varies with the interests of the instructor and the class. Stability theory, control, time delay systems, Hamiltonian systems, bifurcation theory, and boundary value problems.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('4ef2aad6-dfbc-4ea0-bc08-302c1653f647', null, 'Analysis of boundary value problems for Laplace''s equation, initial value problems for the heat and wave equations. Fundamental solutions, maximum principles, energy methods. First order nonlinear PDE, conservation laws. Characteristics, shock formation, weak solutions. Distributions, Fourier transform.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('ee0a76ec-002d-4e38-9934-202154b7ebab', null, 'Boundary value problems for elliptic partial differential equations via operator-theoretic methods. Hilbert spaces of functions. Duality, weak convergence. Sobolev spaces. Spectral theory of compact operators. Eigenfunction expansions.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('baa98141-3fd9-45f9-8e1b-afca879cd618', null, 'The students participate in a vertically integrated (undergraduate, graduate and/or postdoctoral, faculty) research group. Format varies, but includes regular meetings, readings and presentations of material. See graduate program''s online syllabus or contact the graduate program director for more information.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('cf94f50b-3313-4f1d-a654-acfb751f7f07', null, 'Lectures, experimental courses, and other special subjects in the fields of animal sciences and veterinary medicine.',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('9623c41c-ae72-473a-a1ac-6874c433967d', null, 'Bachelor of Science',0)
INSERT into KSLU_RICH_TEXT_T (ID, FORMATTED, PLAIN,VER_NBR) VALUES ('8b7df2ea-a0e0-4ca6-b524-5554d3194c92', null, 'Anthropology Major',0)
