INSERT INTO KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('IDENT-2', 'CHEM456', 'CHEM', '400', '456', 'Chemistry 456', 'Chem 456', null, null, null,0)
INSERT into KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('37ecfd9e-b65d-4909-bdc5-6b1300447889', 'AAST233', 'AAST', '200', '233', 'Introduction to Asian American Literature', 'INTRO ASIAN AMERICAN LIT', null, 'kuali.lu.type.CreditCourse.identifier.cross-listed', null,0)
INSERT into KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('4abfaa4f-fce3-44db-83ec-e3845f9b5749', 'AAST298', 'AAST', '200', '298', 'Special Topics in Asian American Studies; Filipino American Studies', 'FILIPINO AMER STUDIES', null, null, null,0)
INSERT into KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('050e4960-e099-4fba-b0dc-37fadb0e7a1a', 'AAST378', 'AAST', '300', '378', 'Experiential Learning', 'EXPERIENTIAL LEARNING', null, null, null,0)
INSERT into KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('d54ab513-eb6e-4d6d-9099-6bc75472d526', 'AAST388', 'AAST', '300', '388', 'Independent Research', 'INDEPENDENT RESEARCH', null, null, null,0)
INSERT into KSLU_CLU_IDENT (ID, CD, DIVISION, LVL, SUFX_CD, LNG_NAME, SHRT_NAME, ST, TYPE, VARTN,VER_NBR) VALUES ('8f3f30c3-7fe1-43e2-84dc-10a038f520ad', 'AAST398', 'AAST', '300', '398', 'Selected Topics in Asian American Studies; Filipino American History and Biography', 'FILLIPINO AM HIST BIO', null, null, null,0)
